import React from "react";

const Projectone = () => {
  return (
    <section id="heroSection" className="hero--section">
    <div className="hero--section--content--box">
      <div className="hero--section--content">
        <h1 className="hero--section--title">
          <span className="hero--section-title--color">My website</span>
        </h1>
        <p className="hero--section-description">
        I designed and developed a vibrant restaurant website that showcases the essence of [Restaurant Name]. The website features a modern and user-friendly interface, crafted with HTML, CSS, and React.
        </p>
      </div>
      <button hclassName="btn btn-primary">View In Github</button>
    </div>
    <div className="hero--section--img">
      <img src="./img/placeholder.png" alt="Hero Section" />
    </div>
    
      
  </section>
  );
};

export default Projectone;
